import React, { useEffect } from 'react';



import "./css/owl.carousel.min.css";
import "./css/owl.theme.default.min.css";
import "./js/jquery.min.js";
import "./js/owl.carousel.min.js";

function InstaFeed() {
  useEffect(() => {
    const feed = new Instafeed({
      accessToken: 'IGQVJYRHdZAaDhFTE5HbUFDZA3RtVzJSdlJIbmZAnODdsckZA6NFlpajdQdEc2QTE3a0FSQ3BKMVNTMjVaVVhrZA3BINzNoV3NMY3poak9xWXZADVHNicG9RdHVzaFFOSVhTd1RaUXN6ejgxNFJHTDdaSUlqbwZDZD',
      limit: 8,
      template:'<div class="item"><a href="{{link}}" target="_blank"><img title="{{caption}}" src="{{image}}" /></a></div>',
      after: function() {
        $('.owl-carousel').owlCarousel({
          loop: true,
          margin: 10,
          nav: false,
          responsiveClass: true,
          responsive: {
            0: {
              items: 1
            },
            600: {
              items: 3
            },
            1000: {
              items: 5,
              loop: false
            }
          }
        });
      }
    });

    feed.run();
  }, []);

  return <div className="insta-feed"></div>;
}

export default InstaFeed;
